package javaSessionTwoPkg;

public class SwitchClass {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
     String a="safari";
     switch(a) {
     case "chrome" : System.out.println("1");
                         break;
     case "ie" : System.out.println("2");
     					break;
     case "ff" : System.out.println("3");
     					break;
     default :System.out.println("close");
     }
	}

}
